function draw() {

    if (!Global.d3) return
    var node = this.data;
    var root = node;

    var colors = d3.scale.category20b()

    if (!this.chart) this.chart = this.getChart();
        this.chart.selectAll("svg").remove()

        var fill = d3.scale.category20c();
        var format = d3.format(",d");

        var r = Math.min(this.getExtent().x,this.getExtent().y) ;

        var bubble = d3.layout.pack()
            .sort(null)
            .size([r, r])
            .padding(1.5);

        var vis = this.chart.append('svg')
            .attr("width", r)
            .attr("height", r)
            .attr("class", "bubble");

        var w = this.getExtent().x,
            h = this.getExtent().y,
            r = Math.min(w,h),
            x = d3.scale.linear().range([0, r]),
            y = d3.scale.linear().range([0, r]);

     function zoom(d, i) {
        // alert("zoom2")
          var k = r / d.r / 2;
          x.domain([d.x - d.r, d.x + d.r]);
          y.domain([d.y - d.r, d.y + d.r]);

          var t = vis.transition()
              .duration(d3.event.altKey ? 7500 : 750);

          t.selectAll("circle")
              .attr("cx", function(d) { return x(d.x); })
              .attr("cy", function(d) { return y(d.y); })
              .attr("r", function(d) { return k * d.r; });

          t.selectAll("text")
              .attr("x", function(d) { return x(d.x); })
              .attr("y", function(d) { return y(d.y); })
              .style("opacity", function(d) { return k * d.r > 20 ? 1 : 0; });

          node = d;
          d3.event.stopPropagation();
        }

        var nodes = bubble.nodes(this.data);

        vis.selectAll("circle")
            .data(nodes)
            .enter().append("svg:circle")
            .attr("class", function(d) { return d.children ? "parent" : "child"; })
            .attr("cx", function(d) { return d.x; })
            .attr("cy", function(d) { return d.y; })
            .attr("r", function(d) { return d.r; })
            .attr("stroke", function(d) { 
                return d3.hsl(colors(d.lastAuthor)) })
            .attr("fill", function(d) { 
                    if (d.lastModified) {
                        var t = (Date.now() - d.lastModified)
                        n = t / 3600 / 24 / 365 / 1000 / 2
                        return d3.hsl(0,0,Math.min(Math.max(1 - n, 0.2), 0.9))
                    }
            })
            .on("click", function(d) { 
                try {
                    zoom(node == d ? root : d); 
                } catch(e) { $world.logError(e)}}, true);

        var status = this.get('Status')
        var log = function(s) {
            status.textString = s
        }
        vis.selectAll("text")
            .data(nodes)
            .enter().append("svg:text")
            .attr("class", function(d) { return d.children ? "parent" : "child"; })
            .attr("x", function(d) { return d.x; })
            .attr("y", function(d) { return d.y; })
            .attr("dy", function(d) { return d.children ? "-.5em" : "0.5em"})
            .attr("text-anchor", "middle")
            .attr("fill", function(d) {
                return  d3.hsl(colors(d.lastAuthor))
            })
            .style("opacity", function(d) { return d.r > 20 ? 1 : 0; })
            .text(function(d) { return d.name; })
            .on("click", function(d) { 
                try {
                    log('' + d.name + ', '+ d.lastAuthor + ', ' + new Date(d.lastModified))
                } catch(e) { $world.logError(e)}}, true);

     // d3.select(window).on("click", function() { zoom(root); });

}

